The easiest way to do unit testing is to create functions marked with the #[test] macro. We can do this anywhere within the crate. We haven't talked about function syntax yet but for now we will use the following add function: fn add(a: u32, b: u32) -> u32 { a + b
} A unit test looks like this: #[test]
fn test_add() { assert_eq!(add(7, 12), 19); assert_ne!(add(8, 8), 0);
} #[test], assert_eq!(), and assert_ne!() are all macros.

