fn main() { println!("Hello, world!");
} fn add(a: u32, b: u32) -> u32 { a + b
} #[cfg(test)]
mod tests { use super::add; #[test] fn test_add_0() { assert_eq!(add(7, 12), 19); } #[test] fn test_add_1() { assert_eq!(add(23, 56), 79); } #[test] fn test_add_2() { assert_ne!(add(2, 2), 5); }
} mod tests { ... } creates a submodule called tests. use super::add; imports the add() function from the containing module. #[cfg(test)] tells cargo to only compile this code when running cargo test and not in a normal build.
